import React from "react";
import "./SearchImagePage.scss";
import SearchImage from "../../Components/SearchImage/SearchImage";
import { connect } from "react-redux";
import { selectSearchImageById } from "../../Redux/Search/search-selectors";
import { fetchImageDataAsync } from "../../Redux/Search/search-actions";

class SearchImagePage extends React.Component {

  componentDidMount() {
      const {fetchImageDataAsync} = this.props;
      fetchImageDataAsync(this.props.match.params.searchId)
  }

  render() {
      const {searchImageById} = this.props;
    return (
      <div className="searchimagepage">

      </div>
    );
  }
}

const mapStateToProps = (state, ownProps) => ({
  searchImageById: selectSearchImageById(ownProps.match.params.searchId)(state)
});

const mapDispatchToProps = dispatch => ({
  fetchImageDataAsync: id => dispatch(fetchImageDataAsync(id))
});

export default connect(mapStateToProps, mapDispatchToProps)(SearchImagePage);
